import React from 'react';
import CategorySidebar from '../categories/CategorySidebar';
import RecipeList from '../recipes/RecipeList';


const Main = () => {
    return (
        <div className="row">
            <div className="col-4">
                <CategorySidebar />
            </div>

            <div className="col-8">
                <RecipeList />
            </div>
        </div>
    )
}

export default Main;
